import React, { useState } from "react";

export default function JourneyTimeline({ journey }) {
  const episodes = Array.isArray(journey) ? journey : [];

  return (
    <div style={card}>
      <h3 style={title}>Member Journey</h3>
      {!episodes.length ? (
        <div style={{ color: "#64748b" }}>No journey data.</div>
      ) : (
        <div style={{ display: "grid", gap: 12 }}>
          {episodes.map((ep, idx) => (
            <Episode key={idx} data={ep} />
          ))}
        </div>
      )}
    </div>
  );
}

function Episode({ data }) {
  const [open, setOpen] = useState(false);
  const {
    month,
    episode,
    metrics = {},
    conversations = [],
  } = data || {};

  const msgCount = metrics?.messages ?? conversations.length ?? 0;
  const decCount = metrics?.decisions ?? 0;

  return (
    <div style={row}>
      <div style={{ display: "flex", alignItems: "center", gap: 12 }}>
        <button onClick={() => setOpen((v) => !v)} style={btn}>
          {open ? "−" : "+"}
        </button>
        <div>
          <div style={{ fontWeight: 600 }}>{episode || "Episode"}</div>
          <div style={{ fontSize: 12, color: "#64748b" }}>
            Month {month ?? "—"} · {msgCount} messages · {decCount} decisions
          </div>
        </div>
      </div>

      {open && (
        <div style={{ marginTop: 12, paddingLeft: 36 }}>
          {(conversations || []).slice(0, 6).map((c, i) => (
            <div key={i} style={conv}>
              <div style={convTop}>
                <span style={pill}>{c?.role || c?.sender || "—"}</span>
                <span style={{ color: "#64748b", fontSize: 12 }}>{c?.timestamp || "—"}</span>
              </div>
              <div style={{ fontWeight: 600, marginBottom: 4 }}>{c?.topic || "—"}</div>
              <div style={{ whiteSpace: "pre-wrap" }}>{c?.message || "—"}</div>
            </div>
          ))}
          {(conversations || []).length > 6 && (
            <div style={{ color: "#0ea5e9", fontSize: 13, marginTop: 8 }}>
              +{(conversations || []).length - 6} more…
            </div>
          )}
        </div>
      )}
    </div>
  );
}

const card = { background: "#fff", border: "1px solid #e2e8f0", borderRadius: 12, padding: 16 };
const title = { margin: 0, paddingBottom: 8, borderBottom: "1px solid #e2e8f0", fontSize: 16 };
const row = { border: "1px solid #e2e8f0", borderRadius: 10, padding: 12 };
const btn = { width: 28, height: 28, borderRadius: 6, border: "1px solid #cbd5e1", background: "#f8fafc", cursor: "pointer" };
const conv = { background: "#f8fafc", border: "1px solid #e2e8f0", borderRadius: 8, padding: 10, marginBottom: 8 };
const convTop = { display: "flex", justifyContent: "space-between", marginBottom: 6 };
const pill = { padding: "2px 8px", background: "#e2e8f0", borderRadius: 999, fontSize: 12 };
